import React from "react";

function AboutUs() {
  return (
    <div>
      <div className="slogan-container">
        <h1>"Un vistazo a lo que nos importa"</h1>
      </div>
      <div className="aboutus-container">
        <p>
          "Somos una revista de estretenimiento y estilo de vida que lleva
          inspiración e innovación, con frescura y contenido de calidad. Su ADN
          es innovador, fresco e inclusivo."
        </p>
      </div>
    </div>
  );
}

export default AboutUs;
